import React from "react";
import Navbar from "./Navbar";
import NavPage from "./NavPage";
import SidebarData from "../data/SidebarData";

const MainPage = () => {
  return (
    <React.Fragment>
      {/* heading section */}
      <section>
        <div>
          <Navbar />
        </div>
      </section>

      {/* sidebar section */}
      <section>
        <div className="d-flex">
          
             <SidebarData/>
         


         
              <NavPage className="bg-light"/>
          
        </div>
      </section>
    </React.Fragment>
  );
};

export default MainPage;
